import{_ as i,a,b as e,c as r}from"./chunks/c-rtk2_pinouts2.CEnvpmeV.js";import{_ as t,c as u,a8 as o,o as s}from"./chunks/framework.BDnHobkS.js";const g=JSON.parse('{"title":"CUAV C-RTK2 GNSS Module (RTK/PPK)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/gps_compass/rtk_gps_cuav_c-rtk2.md","filePath":"uk/gps_compass/rtk_gps_cuav_c-rtk2.md"}'),n={name:"uk/gps_compass/rtk_gps_cuav_c-rtk2.md"};function c(p,l,h,m,d,_){return s(),u("div",null,l[0]||(l[0]=[o('<h1 id="cuav-c-rtk2-gnss-module-rtk-ppk" tabindex="-1">CUAV C-RTK2 GNSS Module (RTK/PPK) <a class="header-anchor" href="#cuav-c-rtk2-gnss-module-rtk-ppk" aria-label="Permalink to &quot;CUAV C-RTK2 GNSS Module (RTK/PPK)&quot;">​</a></h1><p>The <a href="https://www.cuav.net/en/c_rtk_9ps/" target="_blank" rel="noreferrer">CUAV C-RTK2 receiver</a> is a high-performance PPK/RTK positioning module created by CUAV for professional applications such as drone aerial surveying and mapping. It has a high-precision IMU and positioning module, and can reduce the number of required <a href="https://www.youtube.com/watch?v=3k7v5aXyuKQ" target="_blank" rel="noreferrer">control points</a> by more than to 80%. На додаток до зйомки/картографування, він підходить для багатьох інших випадків використання, включаючи: захист сільськогосподарських рослин та рої дронів.</p><p><img src="'+i+'" alt="C-RTK2"></p><h2 id="інші-характеристики" tabindex="-1">Інші характеристики <a class="header-anchor" href="#інші-характеристики" aria-label="Permalink to &quot;Інші характеристики&quot;">​</a></h2><ul><li>Потужний процесор H7</li><li>Високоточний IMU промислового класу</li><li>Підтримка RTK та одночасне збереження необроблених даних RAW (PPK)</li><li>Багатосупутникові та багаточастотні приймачі</li><li>Протокол UAVCAN/Dronecan</li><li>Підтримка гарячого взуття та спуску спусковик</li><li>Режими HS_USB та U диск</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://store.cuav.net/shop/c-rtk-2/" target="_blank" rel="noreferrer">CUAV Store</a></li><li><a href="https://pt.aliexpress.com/item/1005003754165772.html?spm=a2g0o.store_pc_groupList.8148356.13.2f893550i0NE4o" target="_blank" rel="noreferrer">CUAV aliexpress</a></li></ul><h1 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h1><ul><li>Приймач RTK <ul><li>ZED-F9P</li></ul></li><li>Канал прийому <ul><li>184</li></ul></li><li>Головний FMU процесор <ul><li>STM32H743VIH6(2M flash、1M RAM）</li></ul></li><li>Бортові сенсори: <ul><li>Акселерометр/Гіроскоп: ICM20689</li></ul></li><li>Магнітометр: RM3100 <ul><li>Барометр: ICP10111</li></ul></li><li>Розширення TF-карти <ul><li>32G(MAX)</li></ul></li><li>PPK(пост оброблений кінематологік) <ul><li>підтримка</li></ul></li><li>RTK(Реальний кінематичний час) <ul><li>підтримка</li></ul></li><li>Діапазони GNSS <ul><li>GPS:L1C/A,L2C</li><li>GLONASS:L1OF,L2OF</li><li>GALILEO: E1B/C E5b</li><li>Beidou:B1I B2I</li></ul></li><li>Покращена система <ul><li>QZSS:L1C/A,L2C,L1S</li><li>SBAS:L1C/A</li></ul></li><li>Кількість одночасних GNSS <ul><li>4(GPS、GLONASS、GALILEO、Beidou）</li></ul></li><li>Частота оновлення навігації <ul><li>RTK До 20 Гц</li><li>RAW До 25 Гц</li><li>default：5hz</li></ul></li><li>Час конвергенції <ul><li>RTK &lt; 10 sec</li></ul></li><li>Точність позиціонування (середньоквадратичне значення) <ul><li>RTK:0.01m+1ppm(рівень);0.02m+1ppm(вертикаль)</li><li>GPS:1.5м(рівень)</li></ul></li><li>Отримання даних <ul><li>Холодний запуск 24с</li><li>Допоміжний запуск 2с</li><li>Повторне отримання 2с</li></ul></li><li>Чутливість <ul><li>Tracking &amp; Nav –167 dBm</li><li>Холодний старт –148 dBm</li><li>Гарячий старт –157 dBm</li><li>Повторне отримання –160с</li></ul></li><li>Анти-пуфінг <ul><li>Вдосконалені алгоритми захисту від підробок</li></ul></li><li>Протоколи <ul><li>NMEA</li><li>UBX binary</li><li>RTCM версія 3.x</li></ul></li><li>Часовий імпульс <ul><li>0.25 Гц ~ 10 Гц (налаштовується)</li></ul></li><li>Захист від глушіння <ul><li>Активне виявлення та усунення радіозавад Вбудований фільтр смугового пропускання</li></ul></li><li>Підтримка типу керування польотом <ul><li>Сумісність з польотними контролерами з прошивкою PX4</li></ul></li><li>інтерфейс <ul><li>1 Гарячий роз&#39;єм</li><li>1 затвор в</li><li>1 sutter out</li><li>1 Тип (HS_USB)</li><li>1 F9P USB</li><li>1 F9P UART</li><li>1 Антена(mmcx)</li></ul></li><li>Напруга живлення <ul><li>4.5~6v</li></ul></li><li>Робоча температура <ul><li>-20~85℃</li></ul></li><li>Розмір <ul><li>56x33x16.5mm</li></ul></li><li>Вага <ul><li>39g</li></ul></li></ul><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p><a href="https://doc.cuav.net/gps/c-rtk2/en/quick-start-c-rtk2.html" target="_blank" rel="noreferrer">CUAV Docs</a></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p><img src="'+a+'" alt="C-RTK2"></p><p><img src="'+e+'" alt="C-RTK2"></p><p><img src="'+r+'" alt="C-RTK2"></p><h2 id="докладніше" tabindex="-1">Докладніше <a class="header-anchor" href="#докладніше" aria-label="Permalink to &quot;Докладніше&quot;">​</a></h2><p><a href="https://doc.cuav.net/gps/c-rtk-series/en/c-rtk-9ps/" target="_blank" rel="noreferrer">CUAV Docs</a></p>',17)]))}const S=t(n,[["render",c]]);export{g as __pageData,S as default};
